import React from "react";

function Cart({ Cart }) {
  //   console.log(props);
  return (
    <div>
      {Cart.map((product, idx) => (
        <div key={idx}>
          ><h3>{item.name}</h3>
          <h4>{item.cost}</h4>
          <img className="productimg" src={item.img} />
        </div>
      ))}
    </div>
  );
}

export default Cart;
